import React ,{Component} from 'react';
import {
  DetailWrapper,
  Header
}from './style.js';
class Detail extends Component {
  render(){
    return (
        <DetailWrapper>
          <Header>衡水中学，被外地人占领的高考工厂</Header>
        </DetailWrapper>
    )
  }
}

export default Detail;
